    "burford-lake-wildlife-management-area-september-october-november-and-december-1953",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Burford Lake
    Wildlife Management Area outlines Refuge accomplishments from September through
    December of 1953. The report begins by summarizing the weather conditions and water
    conditions during this period. Wildlife- including migratory birds, upland game
    birds, big game animals, predators, raptors, and fish- is also covered. The Refuge
    development and maintenance section discusses physical developments and wildfires.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, and hunting. Items of interest and N-R forms are attached.",nt"license_title":
